import React from "react";
import { Route, Link } from "react-router-dom";
import DeckList from "./DeckList";
import CreateDeck from "./CreateDeck";

const Home = ({ decks }) => {

    return (
        <div>
            <CreateDeck/>
            <Switch>
                <Route>
                    <DeckList decks={decks} />
                </Route>
            </Switch>
        </div>
    )
}

export default Home;
